import React, { useState } from 'react'

const Chai = () => {
    const [counte, setCount] = useState(0);
  return (
    <div>
      <h2> Counter Value : {counte}</h2>
      <button onClick={()=> setCount(counte+1)}> Add Value</button>
      <br />
      <br />
      <button onClick={()=> setCount(counte-1)}> Remove value </button>
    </div>
  )
}

export default Chai
